[{"location":"","page":"Home","title":"Home","text":"CurrentModule = GromovWitten","category":"page"},{"location":"#GromovWitten","page":"Home","title":"GromovWitten","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for tropicalfeynman.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [GromovWitten]","category":"page"},{"location":"#GromovWitten.GromovWitten","page":"Home","title":"GromovWitten.GromovWitten","text":"GromovWitten  is a package for computing Feynman Integral via Gromov-Witten invariant.\n\n\n\n\n\n","category":"module"},{"location":"#GromovWitten.Sfunction-Tuple{Nemo.QQMPolyRingElem, Int64}","page":"Home","title":"GromovWitten.Sfunction","text":"Sfunction(z::QQMPolyRingElem,k::Int64) Note:The function Sfunction(z,k) takes account vertex contributions.  S (z aa) = sum_n = 0^aa dfrac2^- 1 - n (1 + (- 1)^n) (n + 1)  z^n = sum_n = 0^aa dfrac2^- 2 n (2 n + 1)  z^n aa rightarrow infty\n\nExamples\n\njldoctest julia> Sfunction(z[1],4) 1//92897280*z[1]^8 + 1//322560*z[1]^6 + 1//1920*z[1]^4 + 1//24*z[1]^2`\n\n\n\n\n\n","category":"method"},{"location":"#GromovWitten.partition-Tuple{Integer, Integer}","page":"Home","title":"GromovWitten.partition","text":"partition(k::Integer, n::Integer)    \n\nNote:This function returns the number of partitions of n into fixed  k parts. \n\nExamples\n\njldoctest julia> partition(3,4) 15-element Vector{Vector{Int64}}:  [4, 0, 0]  [3, 1, 0]  [3, 0, 1]  [2, 2, 0]  [2, 1, 1]  [2, 0, 2]  [1, 3, 0]  [1, 2, 1]  [1, 1, 2]  [1, 0, 3]  [0, 4, 0]  [0, 3, 1]  [0, 2, 2]  [0, 1, 3]  [0, 0, 4]`\n\n\n\n\n\n","category":"method"},{"location":"","page":"Home","title":"Home","text":"To run:\n- pull the package in your local disk\nIn the local folder where the package is located, type in the terminal.\n- julia --project\n-  using GromovWitten\n-  ve=[(1, 2), (1,2),(2, 4), (1, 3) ,(3, 4),(3,4)]\n-   G=graph(ve)\n-   R,x,q=polynomial_ring(G,\"x\",\"q\")\n-  a=[0,2,1,0,0,1]\n-  feynman_integral_branchtype(x,q,G,a)\n-  feynman_integral_degree(x,q,G ,4)\n-  subt(R,x,q,feynman_integral_degree(x,q,G ,4))\n","category":"page"},{"location":"Feynman Integral/Feynman/#Feynman-Integral","page":"Feynman Integral","title":"Feynman Integral","text":"","category":"section"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"CurrentModule = GromovWitten\nDocTestSetup = quote\n  using GromovWitten\nend","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"using GromovWitten","category":"page"},{"location":"Feynman Integral/Feynman/#Graph","page":"Feynman Integral","title":"Graph","text":"","category":"section"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"A Feynman graph is a (non-metrized) graph Î“ without ends with n vertices which are labeled $ x1, . . . , xn $ and with labeled edges q_1     q_r. The graph G is represented as a collection of vertices V and edges E. Each edge is a pair (vw) where both v and w are elements of the set of vertices V.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"<img src=\"https://github.com/singular-gpispace/tropicalfeynman/assets/46294807/c5b4b792-6d2f-418f-b38a-21b3c0187a92\" width=\"300\" />","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia> ve=[(1, 1), (1, 2), (2, 3), (3, 1)]\n4-element Vector{Tuple{Int64, Int64}}:\n (1, 1)\n (1, 2)\n (2, 3)\n (3, 1)","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"and","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia> G=graph(ve)\ngraph([(1, 1), (1, 2), (2, 3), (3, 1)])","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"We then define the Rxq=polynomialring(G) from the graph G.  The polynomial ring has $ 5g-5$ variables, consisting of two sets of variables: x_1x_2x_2g-2 and q_1q_2q_3g-3.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia>   R,x,q,z=polynomial_ring(G,\"x\",\"q\",\"z\")\n(Multivariate polynomial ring in 10 variables over QQ, Nemo.QQMPolyRingElem[x[1], x[2], x[3]], Nemo.QQMPolyRingElem[q[1], q[2], q[3], q[4]], Nemo.QQMPolyRingElem[z[1], z[2], z[3]])","category":"page"},{"location":"Feynman Integral/Feynman/#Feynman-Integral-branche-type","page":"Feynman Integral","title":"Feynman Integral branche type","text":"","category":"section"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"For a given branch type a, we compute the Specific Feynman Integral of the labeled Graph. a is a list of partition of degree d=3 of Gamma.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia> a=[2,0,0,1]\n4-element Vector{Int64}:\n 2\n 0\n 0\n 1","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"o","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"is a fixed order of vertices.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia> o=[1,2,3]\n3-element Vector{Int64}:\n 1\n 2\n 3","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"We compute the Specific Feynman Integral for the Graph G given a fixed vertex ordering o and the partition of degree a. Here we have the defaults values of the leak vector and the genus function  l=[0,0,0], g=[0,0,0] and we set the order of Sfunction $ aa=0$","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia>  feynman_integral_branchtype_order(x,q,z,G,a,o,aa=0,l=[0,0,0],g=[0,0,0])\n3*q[1]^2*q[4]","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"In the case l=[0,0,0], g=[0,0,0] and  $ aa=0$ we can write simply write.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia>  feynman_integral_branchtype_order(x,q,z,G,a,o)\n3*q[1]^2*q[4]","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"We compute the Specific Feynman Integral for the Graph G given a fixed partition of degree a for all vertex ordering o. Here we have the defaults values of the leak vector and the genus function  l=[0,0,0], g=[0,0,0] and we set the order of Sfunction $ aa=0$","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia> feynman_integral_branchtype(x,q,z,G,a)\n6*q[1]^2*q[4]","category":"page"},{"location":"Feynman Integral/Feynman/#Feynman-Integral-2","page":"Feynman Integral","title":"Feynman Integral","text":"","category":"section"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"We compute the  Feynman Integral of the graph G over all  partitions of the degree d=3  for a fixed ordering o.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia> feynman_integral_degree_order(x,q,z,G,o,3) # here d=3\n3*q[1]^2*q[4] + q[1]*q[2]*q[3] + q[1]*q[2]*q[4] + q[1]*q[3]*q[4] + 9*q[1]*q[4]^2\n","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"We compute the Feynman integral over all the partitions of the degree d of graph G for all vertex ordering.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia>  feynman_integral_degree(x,q,z,G,3) # here d=3\n6*q[1]^2*q[2] + 6*q[1]^2*q[3] + 6*q[1]^2*q[4] + 18*q[1]*q[2]^2 + 6*q[1]*q[2]*q[3] + 6*q[1]*q[2]*q[4] + 18*q[1]*q[3]^2 + 6*q[1]*q[3]*q[4] + 18*q[1]*q[4]^2","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"We compute the sum of coefficients.","category":"page"},{"location":"Feynman Integral/Feynman/","page":"Feynman Integral","title":"Feynman Integral","text":"julia> subt( feynman_integral_degree(x,q,z,G,3)\n90","category":"page"}]
